export class AuthService {
  constructor() {
    this.loggedIn = false;
  }
  isAuthenticated() {
    return new Promise(resolve => {
      setTimeout(() => {
        resolve(this.loggedIn);
      }, 800);
    });
  }
  login() {
    this.loggedIn = true;
  }
  logout() {
    this.loggedIn = false;
  }
}
